abstract contract ReentrancyGuard {
    // Booleans are more expensive than uint256 or any type that takes up a full
    // word because each write operation emits an extra SLOAD to first read the
    // slot's contents, replace the bits taken up by the boolean, and then write
    // back. This is the compiler's defense against contract upgrades and
    // pointer aliasing, and it cannot be disabled.

    // The values being non-zero value makes deployment a bit more expensive,
    // but in exchange the refund on every call to nonReentrant will be lower in
    // amount. Since refunds are capped to a percentage of the total
    // transaction's gas, it is best to keep them low in cases like this one, to
    // increase the likelihood of the full refund coming into effect.
    uint256 private constant NOT_ENTERED = 1;
    uint256 private constant ENTERED = 2;

    uint256 private _status;

    /**
     * @dev Unauthorized reentrant call.
     */
    error ReentrancyGuardReentrantCall();

    constructor() {
        _status = NOT_ENTERED;
    }

    /**
     * @dev Prevents a contract from calling itself, directly or indirectly.
     * Calling a `nonReentrant` function from another `nonReentrant`
     * function is not supported. It is possible to prevent this from happening
     * by making the `nonReentrant` function external, and making it call a
     * `private` function that does the actual work.
     */
    modifier nonReentrant() {
        _nonReentrantBefore();
        _;
        _nonReentrantAfter();
    }

    function _nonReentrantBefore() private {
        // On the first call to nonReentrant, _status will be NOT_ENTERED
        if (_status == ENTERED) {
            revert ReentrancyGuardReentrantCall();
        }

        // Any calls to nonReentrant after this point will fail
        _status = ENTERED;
    }

    function _nonReentrantAfter() private {
        // By storing the original value once again, a refund is triggered (see
        // https://eips.ethereum.org/EIPS/eip-2200)
        _status = NOT_ENTERED;
    }

    /**
     * @dev Returns true if the reentrancy guard is currently set to "entered", which indicates there is a
     * `nonReentrant` function in the call stack.
     */
    function _reentrancyGuardEntered() internal view returns (bool) {
        return _status == ENTERED;
    }
}

//AIFinance合约中 有77.5%的NBO代币，NBO的上线价格为1U
contract AIFinance is Ownable,ReentrancyGuard{
    using SafeMath for uint256;
    
    uint256 public buyToLpFee = 30;
    uint256 public buyToInsuranceAddressFee = 20;
    uint256 public buyToTeamAddressFee = 30;
    uint256 public buyToMarketAddressFee = 20;
    uint256 public buyAmount = 500;

    address private insuranceAddress = 0x49383045A516e5eDBDb3Df296A73C455810561A7;
    address private teamAddress = 0x875562C0a3ffE8B9AD33444F9Fd6b89cF18De149;
    address private marketAddress = 0x8C30Ba81e9102E8f4D50AFCEbC5456261D48e51E;

    address private deadAddress = 0x000000000000000000000000000000000000dEaD;

    //NBO和USDT地址
    address public NBO;
    address public USDT;

    //bsc上路由
    address public uniswapV2Router;
    address public uniswapV2Pair;

    mapping(address => bool) public isBuy;

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );
    event buyAiFinanceEvent(address indexed sender,uint256 amount,uint256 time);

    constructor(address _nboAddress,address _usdtAddress){
        NBO = _nboAddress;
        USDT = _usdtAddress;

        uniswapV2Router = 0x10ED43C718714eb63d5aA57B78B54704E256024E; //router
        uniswapV2Pair = IUniswapV2Factory(IUniswapV2Router02(uniswapV2Router).factory()).getPair(NBO,USDT); //NBO和usd交易对

        IERC20(USDT).approve(address(uniswapV2Router),type(uint256).max);
        IERC20(NBO).approve(address(uniswapV2Router),type(uint256).max);
    }

    //清除用户购买
    function setIsBuyToFalse(address user) public onlyOwner{
        isBuy[user] = false;
    }

    function setBuyAmount(uint256 amount) public onlyOwner{
        buyAmount = amount;
    } 

    function buyAiFinance() public nonReentrant returns(bool){
        if(isBuy[msg.sender]){
            return false;
        }
        isBuy[msg.sender] = true;

        uint256 amount = buyAmount*1e18; //单笔购买默认为500u

        require(IERC20(USDT).allowance(msg.sender,address(this)) >= amount,"allowance is not enough");
        require(IERC20(USDT).balanceOf(msg.sender) >= amount,"sender dont have enough usdt");
        IERC20(USDT).transferFrom(msg.sender,address(this),amount);

        uint256 swapAndAddLpAmount = amount.mul(buyToLpFee).div(100);
        swapAndLiquify(swapAndAddLpAmount); //将30%的amount中的一半交换成NBO后加入池子
        
        distributeToAddress(amount); //减去30%的加池子费后，将剩下的USDT分配给几个地址

        emit buyAiFinanceEvent(msg.sender,amount,block.timestamp);

        return true;
    }

    function distributeToAddress(uint256 amount) private{
        uint256 buyToInsuranceAmount = amount.mul(buyToInsuranceAddressFee).div(100);
        uint256 buyToTeamAddressAmount = amount.mul(buyToTeamAddressFee).div(100);
        uint256 buyToMarketAddressAmount = amount.mul(buyToMarketAddressFee).div(100);
        IERC20(USDT).transfer(insuranceAddress,buyToInsuranceAmount);
        IERC20(USDT).transfer(teamAddress,buyToTeamAddressAmount);
        IERC20(USDT).transfer(marketAddress,buyToMarketAddressAmount);
    } 

    //将ai进场资金的30%中一半兑换成NBO与另一半添加进LP池子
    function swapAndLiquify(uint256 amount) private {
        uint256 half = amount.div(2);
        uint256 otherHalf = amount.sub(half);

        uint256 initialBalance = address(this).balance;

        swapUSDTForNBO(half); // <- this breaks the USDT -> NBO swap when swap+liquify is triggered

        uint256 newBalance = address(this).balance.sub(initialBalance);

        // add liquidity to uniswap
        addLiquidity(half,IERC20(NBO).balanceOf(address(this)));

        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

    function swapUSDTForNBO(uint256 amount) private {
        address[] memory path = new address[](2);
        path[0] = USDT;
        path[1] = NBO;

        // make the swap
        IUniswapV2Router02(uniswapV2Router).swapExactTokensForTokensSupportingFeeOnTransferTokens(
            amount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    //添加NBO_USDT的池子
    function addLiquidity(uint256 usdtAmount, uint256 nboAmount) private {
        // add the liquidity
        IUniswapV2Router02(uniswapV2Router).addLiquidity(
            NBO,
            USDT,
            nboAmount,
            usdtAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            deadAddress,
            block.timestamp
        );
    }

    function showNBOToUSDTPrice() public view returns(uint256,uint256){
        return (IERC20(NBO).balanceOf(uniswapV2Pair),IERC20(USDT).balanceOf(uniswapV2Pair));
    }

    //提取该合约中的某个代币
    function withdrawToken(address tokenAddress,uint256 amount) public onlyOwner{
        IERC20(tokenAddress).transfer(msg.sender,amount);
    }
    function withdrawETH() public onlyOwner{
        (bool _bool,) = payable(msg.sender).call{value:address(this).balance}("");
        require(_bool,"withdrawETH failed");
    }

    receive() external payable{}
}
